import React, { useState } from 'react';

function Quiz() {
  const [answers, setAnswers] = useState({});

const handleSubmit = (event) => {
  event.preventDefault();
  // Log the answers to check if they are being updated correctly
  console.log('User answers:', answers);
};

  const handleAnswerChange = (questionNumber, answer) => {
    setAnswers({ ...answers, [questionNumber]: answer });
  };

  return (
    <div>
      <h1>Quiz App</h1>
      <form onSubmit={handleSubmit}>
        {/* Question 1 */}
        <div>
          <p>Question 1: How often do you feel sad or hopeless?</p>
          <label>
            <input
              type="radio"
              name="question1"
              value="Never"
              onChange={() => handleAnswerChange('question1', 'Never')}
            />
            Never
          </label>
          <label>
            <input
              type="radio"
              name="question1"
              value="Rarely"
              onChange={() => handleAnswerChange('question1', 'Rarely')}
            />
            Rarely
          </label>
          <label>
            <input
              type="radio"
              name="question1"
              value="Sometimes"
              onChange={() => handleAnswerChange('question1', 'Sometimes')}
            />
            Sometimes
          </label>
          <label>
            <input
              type="radio"
              name="question1"
              value="Often"
              onChange={() => handleAnswerChange('question1', 'Often')}
            />
            Often
          </label>
        </div>
        {/* Submit button */}
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Quiz;
